        image:"https://images.unsplash.com/photo-1523381210434-271e8be1f52b?ixid=MnwxMjA3fDB8MHxzZWFyY2h8M3x8Y2xvdGhpbmd8ZW58MHx8MHx8&ixlib=rb-1.2.1&auto=format&fit=crop&w=500&q=60",
        product_name:"Product Name",
        brand:"Product Brand",
        quantity:7,
        popularity:"high"
    }
    return (
        <div style={{margin:"0 64px"}}>
            <OrdersCards orders={ORDERS} >

            </OrdersCards>
        </div>
    )
}
